import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

//Искам да направя компонент Page, който да ми държи цялата страница(Header, Sidebar, MainBody) и тук да сложа само Page компонента и NotFound компонента.

//Оставям го така засега, за да работи.
import Header from './components/Header';
// import Sidebar from './components/Sidebar';
// С Routes ли трябва да се промени контента при цъкане или със State?? -> Nested Routes || useState
// import MainBody from './components/MainBody';
import NotFound from './components/NotFound';

function App() {
  return (
    <BrowserRouter>
      <div>
        <Switch>
          <Route exact path="/not-found">
            <NotFound />
          </Route>
          <Route exact path="/">
            <Header />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
